"""Como funciona a rede neural convolucional
Para facilitar o entendimento, vamos imaginar que a entrada da rede seja uma imagem de tamanho qualquer. Além disso, vamos pensar apenas em imagens em escala de cinza (1 canal de cor), com cada pixel variando de 0 a 255 (preto a branco).

Explicando os comandos:
- model.add() -> cria um modelo sequencial
- model.compile() -> configura o modelo com as perdas e as métricas
- model.fit() -> treina o modelo

- layers.Conv2D() -> cria um kernel de convolução com a camada de entrada para produzir um tensor de saída
  
  -> quando é a primeira camada, precisamos usar o input_shape

  -> função de ativação: sem ela a camada só pode aprender transformações lineares 
  
        A (rectified linear unit) is a function meant to zero-out negative values, while a sigmoid "squashes" arbitrary values into the interval, [0, 1], thus outputting something that can be interpreted as a probability.

- layers.MaxPooling2D() -> 

- O que é uma convnet?
  É uma pilha de camadas Conv2D e MaxPooling2D.
- O output das camdas Conv2D e MaxPooling é um tensor 4D

Modelo sequencial do Keras


O Keras é uma API de redes neurais em Python, fácil de usar e capaz de rodar em cima das bibliotecas de linguagens de aprendizagem profundas (deep learning), como TensorFlow, CNTK ou Theano. Ela provê uma estrutura que permite compilar redes neurais combinando camadas de diferentes dimensões e funções de ativação, tornando o ciclo de desenvolvimento de novos modelos de aprendizado de máquina muito mais rápido.

O modelo sequencial permite inserir camadas de uma rede neural em série, onde o output da primeira camada serve como input da segunda, e assim por diante. Para “instanciar” (criar um objeto alocando um espaço na memória para posteriormente usar os métodos e atributos que ele dispõe), devem ser usadas as seguintes linhas:

from keras.models import Sequential
from keras.layers import Dense
model = Sequential()
Você pode criar um modelo sequencial passando uma lista de instâncias de camada para o construtor diretamente dentro dos parênteses ou adicionando camadas através do método “.add()” – forma adotada, por ficar mais didático. Dos tipos de camadas do Keras, a “Dense” é a mais utilizada. Ela tem como objetivo calcular uma função de ativação em conjunto com os dados de entrada e pesos.

![Screenshot 2022-12-14 at 08-45-52 Recentes - Google Drive.png](data:image/png;base64,)
"""

#Neste momento começa a parte de criar modelo do CNN para treinamento e validação
#Lembrando que o modelo CNN: 
from keras import layers
#pacote que permite que se use tudo que o keras tem, e nele tem os subpacotes layers (chama as camadas de convolução, por ex) e o pacote models (permite que se inice um modelo, inicie as camadas de convoluções, etc, por ex)
from keras import models
#estamos usando o models para criar um modelo só, mas podem ser criados mais modelos na mesma rede

#o modelo sequencial é uma forma de inicar a rede 
model = models.Sequential()

model.add(layers.Conv2D(32, (3, 3), activation='relu', input_shape=(150, 150, 3)))
model.add(layers.MaxPooling2D((2, 2)))

model.add(layers.Conv2D(64, (3, 3), activation='relu'))
model.add(layers.MaxPooling2D((2, 2)))

model.add(layers.Conv2D(128, (3, 3), activation='relu'))
model.add(layers.MaxPooling2D((2, 2)))

model.add(layers.Conv2D(128, (3, 3), activation='relu'))
model.add(layers.MaxPooling2D((2, 2)))

model.add(layers.Flatten())
model.add(layers.Dense(512, activation='relu'))
model.add(layers.Dense(1, activation='sigmoid'))

#resumindo o modelo conforme ocorre a aplicação das convoluções
#max_pooling2D ira diminuir a dimensão das imagens pela metade e aplicar um kernel de tamanho 2x2 e pegar o maior valor daquela matriz para gerar a proxima convolução
#max_pooling2D serve para diminuir a quantidade de nós que você tem na rede, para otmizar o tempo de treinamento e muitas vezes melhorar o resultado
model.summary()

from tensorflow.keras import optimizers

#defini-se a função da taxa de perda
#o optimizer é a função que vai fazendo os ajustes dos pesos dos filtros para melhorar o treinamento da rede
#RMSprop é o otmizador escolhido
model.compile(loss='binary_crossentropy',
optimizer=optimizers.RMSprop(lr=1e-4),
#o acc é a acuracia do treinamento da rede
metrics=['acc'])

"""Validação: busca-se estimar o quão preciso é um modelo na prática, ou seja, o seu desempenho em um novo conjunto de dados.

Idealmente, o modelo deve ser avaliado em amostras que não foram usadas para construir ou ajustar o modelo, de modo que forneçam um senso imparcial de eficácia do modelo. Quando uma grande quantidade de dados está à mão, um conjunto de amostras pode ser reservado para avaliar o modelo final - este é o set de teste - que não deve ser tocado até esta avaliação final. O set de treinamento é usado  para criar o modelo, enquanto o set de validação é usado para ajustar o desempenho.
"""

from keras.preprocessing.image import ImageDataGenerator
#nesta célula fazemos um pré processamento bem simples

# All images will be rescaled by 1./255
train_datagen = ImageDataGenerator(rescale=1./255)
test_datagen = ImageDataGenerator(rescale=1./255)

train_generator = train_datagen.flow_from_directory(
        # This is the target directory
        train_dir,
        # All images will be resized to 150x150
        target_size=(150, 150),
        batch_size=2,
        # Since we use binary_crossentropy loss, we need binary labels
        class_mode='binary')

validation_generator = test_datagen.flow_from_directory(
        validation_dir,
        target_size=(150, 150),
        #colocando um batch size menor é consumido menos memória
        batch_size=2,
        #como nosso problema envolve duas classes, usamos o modo binário
        class_mode='binary')

#aqui é feito o treinamento
#o fit é o que faz o treinamento, e o generator é uma forma de usa-lo 
history = model.fit_generator(
train_generator,
#epochs é a quantidade de ciclos de treinamento que nossa rede irá fazer
#se aumenta muito a epoch pode ser que dê overfitting
epochs=30,
#a base de validação é a base alvo para testar se a rede esta sabendo diferencias se a classificação esta acontecendo corretamente 
validation_data=validation_generator)

#loss é a taxa de perda do treinamento
#acc --> acuracia 

#existem funções para voltarmos na rede de algum ciclo que teve a melhor acuracia, checkpoint

import matplotlib.pyplot as plt

plt.plot(history.history['acc'])
plt.plot(history.history['val_acc'])
plt.title('model accuracy')
plt.ylabel('accuracy')
plt.xlabel('epoch')
plt.legend(['train', 'test'], loc='upper left')
plt.show()
# summarize history for loss
plt.plot(history.history['loss'])
plt.plot(history.history['val_loss'])
plt.title('model loss')
plt.ylabel('loss')
plt.xlabel('epoch')
plt.legend(['train', 'test'], loc='upper left')
plt.show()

test_generator = test_datagen.flow_from_directory(
test_dir,
target_size=(150, 150),
batch_size=2,
class_mode='binary')
test_loss, test_acc = model.evaluate(test_generator)
print('test acc:', test_acc)